// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract ItemStore {
  struct Item {
    string name;
    int value;
  }

  Item[] private Items;

  function addItem(Item memory item) public {
    Items.push(item);
  }
}
